import React from 'react';
import ReactDOM from 'react-dom/client';
import {TextField}   from '@mui/material/TextField';

export default class Field extends React.Component{
    constructor(props){
      super(props)
    }
    render()
    {
      const {label,name,type}=this.props
      return(
        <div>
           <TextField
          required
          id={name}
          label={label}
          type={type}
        />
        </div>
      )
    }
  }
